import React, { Component } from 'react'

export class card extends Component {
    constructor(props){
        super(props)
        this.state={
            name:this.props.name ,
            email:this.props.email ,
            phone:this.props.phone ,
            websit:this.props.websit

        }
    }
    render() {
        return (
          <div class="card" styles="padding:10px ">
            <div class="card-body">
              <h5 class="card-title">{this.state.name}</h5>
              <h6 class="card-subtitle mb-2 text-muted">{this.state.email}</h6>
              <h6 class="card-subtitle mb-2 text-muted">{this.state.phone}</h6>
             <h6 class="card-subtitle mb-2 text-muted">{this.state.websit}</h6>
              <p class="card-text">

              </p>
            </div>
          </div>
        );
    }
}

export default card
